import React, { Component } from 'react';
import NewTimeline from './NewTimeline';

class Experience extends Component {
  render() {
    return (
        <Fade duration={5000}>
          <p id="experience" style={{paddingTop:'70px'}}>
              <h2>Experience</h2>
              <NewTimeline />
          </p> 
        </Fade>
    );
  }
}

export default Experience;
